import React, { Component } from 'react';
import './App.css';
import "antd/dist/antd.css";
import {Route, BrowserRouter, Router,Link} from "react-router-dom";
import News from "./News";
import LayoutHeader from "./layout/js/Layout-header";
import LayoutFooter from "./layout/js/Layout-footer";


class App extends Component {
  render() {
    return (
        <BrowserRouter>
            <div>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About</Link>
                    </li>
                    <li>
                        <Link to="/topics">Topics</Link>
                    </li>
                </ul>

                <hr />
                <div className="main-route-place">
                    <Route exact path="/" component={LayoutHeader} />
                    <Route path="/about" component={LayoutFooter} />
                    <Route path="/topics" component={News} />
                </div>
            </div>
        </BrowserRouter>
    );
  }
}

export default App;
